import axios from 'axios';
import '../Components/UI/CartDetails.css';
import Cart from '../Components/Content/Cart';
import Footer from '../Components/Footer/Footer';
import Menu from '../Components/Header/Menu';
import Header from '../Components/Header/Header';
import React, { useState, useEffect } from 'react';

const ElectCat = () => {
const [electronicsList, setElectronics] = useState([]);
const baseUrl = "https://fakestoreapi.com/products/category/electronics";

useEffect(()=>{
    axios.get(baseUrl).then((response) => setElectronics(response.date))
},[]);
console.log(electronicsList);
return(
    <div>
        <Header></Header>
        <Menu></Menu>
      <div className='body'>
      <Cart cartItems={electronicsList}></Cart>
      </div>
      <Footer></Footer>
    </div>
);

}
export default ElectCat;
